import EnquiryForm from "../js/EnquiryForm";

function Quote() {
  return (
    <div style={{ paddingTop: "15px" }}>
      <h1 style={{ textAlign: "center" }}>Send us an enquiry</h1>
      <hr style={{ width: "90%" }}></hr>
      <EnquiryForm />
    </div>
  );
}

export default Quote;
